import React from "react";
import styled from "styled-components";

const CardActivities = ({ id, name, season, duration, dificult, created }) => {
  return (
    <ActivityContainer key={id}>
      <span>{id}</span>
      <div>
        <h1>{name}</h1>
      </div>
      <h2>{season}</h2>
      <p>Duraci√≥n: {duration} hrs</p>
      <p>Dificultad: {dificult}</p>
      <p>Creada en: {created}</p>
      
      <div className="seasonsIconos">
        {
          season === "Invierno" ?
            (
              <img
                className="seasonsIcons"
                src="https://cdn-icons-png.flaticon.com/512/2698/2698194.png"
                alt="sun"
              />
            ) : (
              <img
                className="seasonsIcons"
                src="https://cdn-icons-png.flaticon.com/512/2698/2698194.png"
                alt="sun"
              />
            )

            }
      </div>
    </ActivityContainer>
  );
};

export default CardActivities;

const ActivityContainer = styled.section`
  display: flex;
  border: 1px solid black;
  flex-direction: column;
  height: 22rem;
  text-align: center;
  padding: 0.5rem;
  &:nth-child(5) {
    grid-column: 2/4;
  }
  &:nth-child(7),
  :nth-child(1) {
    grid-column: 1/3;
  }
  &:nth-child(8) {
    grid-column: 3/5;
  }
`;
